import React, {Fragment} from 'react';


function OrderList({items, onItemClick}) {

	const onClick = (item) => {
		return(evt) => {
			onItemClick && onItemClick(item);
		}
	};

	return (
		<div className="product-list">
			{items && (
				<table className="table is-fullwidth">
					{items.map((item) => (
						<tr key={item.id}>
							<td>{item.id}</td>
						</tr>
					))}
				</table>
			)}
		</div>
	);
}

export default OrderList;
